import * as React from 'react';
import {useState, useEffect, useCallback} from 'react';
import { render } from 'react-dom';
import Button from '@mui/material/Button';
import Card from '@mui/material/Card';
import CardActions from '@mui/material/CardActions';
import CardContent from '@mui/material/CardContent';
import CardMedia from '@mui/material/CardMedia';
import Grid from '@mui/material/Grid';
import Stack from '@mui/material/Stack';
import Box from '@mui/material/Box';
import Typography from '@mui/material/Typography';
import Container from '@mui/material/Container';
import Link from '@mui/material/Link';


export default function Album() {
 const [data,setData]=useState([]);

  const getData=()=>{
    fetch('../portfolio.json'
    ,{
      headers : { 
        'Content-Type': 'application/json',
        'Accept': 'application/json'
       }
    }
    )
      .then(function(response){
        console.log(response)
        return response.json();
      })
      .then(function(myJson) {
        setData(myJson)
      });
  }
  useEffect(()=>{
    getData()
  },[])

  return (

      <main>
        {/* Hero unit */}
        <Box
          sx={{
            bgcolor: 'background.paper',
            pt: 8,
            pb: 6,
          }}
        >
          <Container maxWidth="sm">
            <Typography
              component="h1"
              variant="h3"
              align="center"
              color="text.primary"
              gutterBottom
            >
              Experience
            </Typography>
            <Typography variant="h5" align="center" color="text.secondary" paragraph>
              Professional front end user interface software application developer with 20 years experience. 
            </Typography>
            <Stack
              sx={{ pt: 4 }}
              direction="row"
              spacing={2}
              justifyContent="center"
            >
            <ul>
            <li gutterBottom><Typography variant="h5" component="h2">Languages </Typography> HTML/5, CSS, JavaScript, PHP, ASP.NET, ASP, ActionScript, UML</li>
<li><Typography variant="h5" component="h2">Frameworks </Typography> AngularJS, Bootstrap, JQuery, AJAX, Node.JS, Jasmine, Django, MXML, OSMF</li>
<li><Typography variant="h5" component="h2">Tools </Typography> Chart.JS, MaterializeCSS, Gulp, Karma, Selenium, Jenkins, TeamCity, Maven, Ant, Bamboo,
CruiseControl, AuthO, Oauth, WordPress, thePlatform, Brightcove, OAS Ad Server, Visio</li>
<li><Typography variant="h5" component="h2">Data sources </Typography> REST, SOAP, JSON, XML, Web Sockets, AWS, Cookies, Local Storage, Shared Object,
SQL, MySQL, MongoDB</li>
<li><Typography variant="h5" component="h2">Operating Systems </Typography> Mac OS, Windows, Linux</li>
<li><Typography variant="h5" component="h2">Software </Typography> Visual Studio, Eclipse, Web Storm, Notepad++, Sublime, Photoshop, Gimp, Flash, Lotus
Notes</li>
<li><Typography variant="h5" component="h2">Version Control </Typography> GIT, GitHub, Bitbucket, SVN, Visual Studio Online, Team Foundation Server</li>
<li><Typography variant="h5" component="h2">Team Communication </Typography> Slack, Skype, Hipchat, GTM, WebEx, Google Hangouts</li>
<li><Typography variant="h5" component="h2">Project Management </Typography> Jira, Atlassian, BaseCamp, Asana, Microsoft Office, Adobe, Google Apps,
Outlook</li>
</ul>
              </Stack>
          </Container>
        </Box>
        <Container sx={{ py: 8 }} maxWidth="md">
          {/* End hero unit */}
          <Grid container spacing={4}>
            {data.map((card) => (
              <Grid item key={card} xs={12} sm={12} md={12}>
                <Card
                  sx={{ height: '100%', display: 'flex', flexDirection: 'column' }}
                >

                  <CardContent sx={{ flexGrow: 1 }}>
                    <Typography gutterBottom variant="h5" component="h2">
                      Heading
                    </Typography>
                    <Typography>
                     {card.skills}
                    </Typography>
                  </CardContent>
                  <CardActions>
                    <Button size="small">View</Button>
                    <Button size="small">Edit</Button>
                  </CardActions>
                </Card>
              </Grid>
            ))}
          </Grid>
        </Container>
      </main>

  );
}
